import React from 'react';


import '../styles/Navbar.css'
import { Link } from 'react-router-dom'


class Navbar extends React.Component {

    state = {
        loggedNavbar: null
    }

    componentDidUpdate(prevProps, prevState) {
        console.log(prevProps)
    }

    render(){
        return (
            <nav className="Navbar">
                <Link to="/">Home Page</Link>
                <br />

                <div>
                    {!this.props.loggedInUser && <Link to="/signup">Sign Up</Link>}
                    <br />
                    {!this.props.loggedInUser && <Link to="/login">Log In</Link>}
                </div>

                <div>
                    {this.props.loggedInUser && <Link to="/profile">Profile</Link>}
                    <br />
                    {this.props.loggedInUser && <button onClick={()=>this.props.logOut()}>Log Out</button>}
                </div>


            </nav>
	    );
    }

}

export default Navbar;
